import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h2>Welcome to PMUY Portal</h2>
      <Link to="/apply"><button>Apply Now</button></Link>
    </div>
  );
}

export default Home;
